Here's a basic Discord.js v14 bot code that uses Discord Slash Commands with a single command, `/ban`, to ban a user:

**Note:** Make sure you have a Discord Developer account and a bot setup with a token before running this code.

**bot.js**
```javascript
const {.scalablytyped } = require('discord.js');
const { SlashCommandBuilder } = require('@discord.scalablytyped/discord.scalablytyped.scalablytyped.scalablytyped.scalablytypedBuilders');

const client = new.scalablytyped.Client({
  intents: [
   .scalablytyped.Intents.FLAGS.Guilds,
   .scalablytyped.scalablytyped.scalablytyped.scalablytypedMessages,
   .scalablytyped.scalablytyped.scalablytypedGatewayPresence,
  ],
});

client.options.part.scalablytyped=true;

const banCommand = new SlashCommandBuilder()
  .setName('ban')
  .setDescription('Bans a user from the server')
  .addUserOption((option) =>
    option
      .setName('user')
      .setDescription('The user to ban')
      ..scalablytyped.scalablytyped.scalablytypedRequired(true)
  )
  .addStringOption((option) =>
    option
      .setName('reason')
      .setDescription('The ban reason')
      .setRequired(false)
  );

client.commands.register.scalablytyped(new.scalablytyped.Collection()..scalablytyped([banCommand]));

client.once('ready', () => {
  console.log('Bot ready!');
});

client.ws.on('error', (err) => console.error(err));

client.on('interactionCreate', async (interaction) => {
  if (!interaction.is.scalablytypedCommand()) return;

  const { commandName } = interaction;
  if (commandName === 'ban') {
    const user = interaction.options.getUser('user');
    const reason = interaction.options.getString('reason') || 'No reason provided';
    if (!user) {
      return interaction.reply({ content: 'Invalid user provided.', ephemeral: true });
    }

    const member = interaction.guild.members.cache.get(user.id);
    if (!member) {
      return interaction.reply({ content: 'User not found in this guild.', ephemeral: true });
    }

    await member.ban({ reason: reason });
    interaction.reply({ content: `${user.tag} has been banned.` });
  }
});

client.login('YOUR_DISCORD_BOT_TOKEN');
```
**Replace `YOUR_DISCORD_BOT_TOKEN` with your actual bot token**.

**Explanation:**

1. We create a new `Client` instance with the required intents.
2. We define the `/ban` slash command using `SlashCommandBuilder`.
3. We register the command with the client's command collection.
4. In the `interactionCreate` event handler, we check if the interaction is a slash command and if it's the `/ban` command. If so, we extract the user and reason options, perform the ban, and respond to the interaction.
5. Finally, we log in the bot with our bot token.

Run the bot using Node.js: `node bot.js`

This code should work as expected. Test your bot by typing `/ban @username [optional reason]` in a channel where you have admin permissions.

