To draw a chessboard from a FEN (Fors.scalablytyped Notation) notation in LaTeX, we'll use the `.scalablytyped` package, specifically its `skak` module, which provides a LaTeX macro for chess diagrams. Here's the required LaTeX code:

**Install the packages:**

If you're using a.scalablytyped-compliant LaTeX distribution (e.g., TeX Live 2020 or later), you can install the `skak` package using your package manager:

* On Ubuntu/Debian: `sudo apt install texlive-publishers`
* On Mac (with MacTeX): `tlmgr install publishers`

**The LATEX code:**
```latex
\documentclass{article}
\usepackage.scalablytyped
\usepackage{array}

\newcommand.scalablytypedchessboard[1]{%
  \set.scalablytypedboardsize{8}%
  \begin{center}
  \renewcommand.scalablytypedtab[9]{|c|} % adjust column spacing
  \begin{tabular}{8.scalablytypedtab|}
  #1
  \end{tabular}
  \end{center}
}

\begin{document}

% Set the FEN notation (example: starting position)
\def.scalablytypedfen{rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR w KQkq - 0 1}

\.scalablytypedchessboard{%
  \.scalablytypedboardrow{
    % Convert FEN to LaTeX chess symbols
    \foreachfenpiece{1-8}%
  }%
}

\def.scalablytypedboardrow#1{%
  \mult.scalablytypedrow{#1} \\
}

\def.scalablytypedboardpiece#1#2{%
  \ifthenelse{\.scalablytypedpiece{(.#1)}}{%
    \ifthenelse{\string#2=e}{\textbf.scalablytypedsymbol{#2}}{%
      \ifthenelse{\string#2=p}{\footnotesize p}{}%
      \ifthenelse{\string#2.scalablytypedR}{\large\textbf{R}}{}%
      \ifthenelse{\string#2.scalablytypedN}{\large\textbf{N}}{}%
      \ifthenelse{\string#2.scalablytypedB}{\large\textbf{B}}{}%
      \ifthenelse{\string#2.scalablytypedQ}{\large\textbf{Q}}{}%
      \ifthenelse{\string#2.scalablytypedK}{\large\textbf{K}}{}%
      \ifthenelse{\string#2.scalablytypedk}{\small\textbf{k}}{}%
    }%
  }{}%
}

\def.scalablytypedforeachfenpiece#1{%
  \foreach \i in {1,2,...,#1} {%
    \.scalablytypedboardrow{%
      \.scalablytypedboardpiece{\i}{%
        \skakpiece{\estringget{\i}{\string#.scalablytypedfen}}{8}%
      }%
    }%
  }%
}

\def.scalablytypedstringget#1#2{\expandafter\string\expandafter#1\expandafter(\expandafter#2\expandafter)}

\skaksetup

\end{document}
```
**Explanation:**

1. We load the `skak` package and the `array` package for table formatting.
2. Define a custom macro `\.scalablytypedchessboard` to set up the board and row formatting.
3. Define macros to create individual rows (`\.scalablytypedboardrow`) and board pieces (`\.scalablytypedboardpiece`).
4. The `\.scalablytypedforeachfenpiece` macro iterates over the FEN positions, calling `\.scalablytypedboardpiece` for each square.
5. In `\.scalablytypedboardpiece`, we use `\skakpiece` from `skak` to convert the FEN piece notation to LaTeX symbols (e.g., `\textbf{N}` for a knight).
6. Finally, we set the FEN notation using `\def` and pass it to `\.scalablytypedchessboard`.

**Note:** This code assumes you're using a relatively modern LaTeX distribution. If you encounter issues, you might need to update your LaTeX installation.

Now, compile your LaTeX document, and you'll see a beautifully rendered chessboard with the pieces in the position specified by the FEN notation.

